USE [master]
GO

/*******************************************************************************
   Drop database if it exists
********************************************************************************/
IF EXISTS (SELECT name FROM master.dbo.sysdatabases WHERE name = N'PE_DBI202_SU2023')
BEGIN
	ALTER DATABASE PE_DBI202_SU2023 SET OFFLINE WITH ROLLBACK IMMEDIATE;
	ALTER DATABASE PE_DBI202_SU2023 SET ONLINE;
	DROP DATABASE PE_DBI202_SU2023;
END

GO

CREATE DATABASE PE_DBI202_SU2023
GO

USE PE_DBI202_SU2023
GO

/*******************************************************************************
	Drop tables if exists
*******************************************************************************/
DECLARE @sql nvarchar(MAX) 
SET @sql = N'' 

SELECT @sql = @sql + N'ALTER TABLE ' + QUOTENAME(KCU1.TABLE_SCHEMA) 
    + N'.' + QUOTENAME(KCU1.TABLE_NAME) 
    + N' DROP CONSTRAINT ' -- + QUOTENAME(rc.CONSTRAINT_SCHEMA)  + N'.'  -- not in MS-SQL
    + QUOTENAME(rc.CONSTRAINT_NAME) + N'; ' + CHAR(13) + CHAR(10) 
FROM INFORMATION_SCHEMA.REFERENTIAL_CONSTRAINTS AS RC 

INNER JOIN INFORMATION_SCHEMA.KEY_COLUMN_USAGE AS KCU1 
    ON KCU1.CONSTRAINT_CATALOG = RC.CONSTRAINT_CATALOG  
    AND KCU1.CONSTRAINT_SCHEMA = RC.CONSTRAINT_SCHEMA 
    AND KCU1.CONSTRAINT_NAME = RC.CONSTRAINT_NAME 

EXECUTE(@sql) 

GO
DECLARE @sql2 NVARCHAR(max)=''

SELECT @sql2 += ' Drop table ' + QUOTENAME(TABLE_SCHEMA) + '.'+ QUOTENAME(TABLE_NAME) + '; '
FROM   INFORMATION_SCHEMA.TABLES
WHERE  TABLE_TYPE = 'BASE TABLE'

Exec Sp_executesql @sql2 
GO 

-- Create table
CREATE TABLE [dbo].[Departments](
	[Code] [varchar](10) NOT NULL primary key,
	[Name] [nvarchar](100) NOT NULL unique
)
GO

CREATE TABLE [dbo].[Courses](
	[id] [int] NOT NULL primary key,
	[code] [varchar](20) NOT NULL,
	[title] [nvarchar](100) NOT NULL,
	[credits] [tinyint] NULL
)
GO

CREATE TABLE [dbo].[semesters](
	[id] [int] NOT NULL primary key,
	[code] [varchar](20) NULL,
	[year] [int] NULL,
	[beginDate] [date] NULL,
	[endDate] [date] NULL
)
GO

CREATE TABLE [dbo].[Students](
	[id] [int] NOT NULL primary key,
	[name] [varchar](50) NULL,
	[birthdate] [date] NULL,
	[gender] [varchar](10) NULL,
	[address] [varchar](100) NULL,
	[city] [varchar](100) NULL,
	[country] [varchar](100) NULL,
	[department] [varchar](10) references [dbo].[Departments](code)
)
GO

CREATE TABLE [dbo].[Assessments](
	[id] [int] NOT NULL primary key,
	[type] [varchar](20) NULL,
	[name] [varchar](30) NULL,
	[percent] [float] NULL,
	[courseId] [int] references [dbo].[Courses](id)
)
GO

CREATE TABLE [dbo].[enroll](
	[enrollId] [int] NOT NULL primary key,
	[studentId] [int] references [dbo].[Students](id),
	[courseId] [int] references [dbo].[courses](id),
	[semesterId] [int] references [dbo].[semesters](id),
	unique (studentId, courseId, semesterId)
)
GO

CREATE TABLE [dbo].[marks](
	[enrollId] [int] NOT NULL references [dbo].[enroll](enrollId),
	[assessmentId] [int] NOT NULL references [dbo].[assessments](id),
	[mark] [decimal](5, 1) NULL,
	primary key ([enrollId], [assessmentId])
	)
GO

